import "./card.styles.css";

const Card = ({  name, email, id }) => (
      <div className="card-container" key={id}>
        <img
          alt={`monster ${name}`}
          src={`https://robohash.org/${id}?set3&size=180x180`}
        />
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    );



export default Card;
